body.script:
function share() {
	const shareData = {
		title: 'El día en dos minutos - Podcast Details',
		text: 'All the public stats of the podcast El día en dos minutos',
		url: 'https://podcastdetails.com/?url=https://fapi-top.prisasd.com/podcast/playser/el_dia_en_dos_minutos_1701/itunestfp/podcast.xml',
	}
	// if(typeof screen.orientation === 'undefined' && window.navigator && window.navigator.share) {
	// 	navigator.share(shareData);
	// 	return;
	// }
	if (window.navigator && window.navigator.share && window.navigator.canShare(shareData) && window.navigator.canShare(shareData) && typeof screen.orientation === 'undefined') {
		navigator.share(shareData);
	} else {
		window.location.href = 'https://wocial.com/?create=1&url='+encodeURIComponent('https://podcastdetails.com/?url=https://fapi-top.prisasd.com/podcast/playser/el_dia_en_dos_minutos_1701/itunestfp/podcast.xml')+'&text='+encodeURIComponent('El día en dos minutos - Podcast Details')+'';
	}
}
